import Navbar from '../navbar';
import './cart.css'

export default function Cart() {
  return (
     <div className="cartpage">
            <header className="cartheader">
                      <Navbar/>
                      <div className="cartpagebox">

                      </div>
            </header>
     </div>
  );
}
